  },[state.length])
  useEffect(() => {
    const key = "AIzaSyBEIqK7j9rLo7FHM4Fdl41EITEsGLHFx9E",
      book = "Harry Poter";
    fetch(
      `https://www.googleapis.com/books/v1/volumes?q=${book}&key=${key}&maxResults=40`
    ).then((res) => {
      setState(res);
    });
  }, []);
  return (
    {lists}
  )
}
export default App;

